import "./Navigator.css";
import Button from "./Button";
import { useNavigate } from "react-router-dom";

const Navigator = () => {
    const navigate = useNavigate();
    const handlePage = (e) => {
        switch(e){
            case "MAIN": {
                navigate(`/main`);
            }
            case "FRIEND": {
                navigate(`/friend`);
            }
            case "EVALUATE": {
                navigate(`/evaluate`);
            }
            case "MYPAGE": {
                navigate(`/mypage`);
            }
            default : {
                navigate(`/main`);
            }
        }
    }
    return (
        <div className="page_select">
            <Button text="홈"/>     
            <Button text="친구"/>     
            <Button text="맵기 평가"/>     
            <Button text="마이페이지"/>            
        </div>
    )
}

export default Navigator;
